import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract all product data from the page
    const productData = await page.evaluate(() => {
      const products = [];

      // Get all product cards
      const productCards = document.querySelectorAll('.product-card, .category-card');

      productCards.forEach(card => {
        const title = card.querySelector('.product-title, h3')?.textContent?.trim();
        const price = card.querySelector('.product-price')?.textContent?.trim();
        const rating = card.querySelector('.stars')?.textContent?.trim();
        const reviewCount = card.querySelector('.rating-count')?.textContent?.trim();

        if (title) {
          products.push({
            title,
            price: price || 'N/A',
            rating: rating || 'N/A',
            reviewCount: reviewCount || 'N/A',
            timestamp: new Date().toISOString()
          });
        }
      });

      return products;
    });

    // Extract all user profile links and data
    const profileLinks = await page.$$eval('a[href*="Profile"], a[href*="Orders"], a[href*="Wish"]', 
      links => links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      }))
    );

    // Extract search input data
    const searchData = await page.evaluate(() => {
      const searchInput = document.getElementById('searchInput');
      return {
        placeholder: searchInput?.placeholder,
        value: searchInput?.value
      };
    });

    // Extract navigation categories
    const categories = await page.$$eval('.nav-links a, .mobile-menu-section a', 
      links => links.map(link => link.textContent.trim())
    );

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Extracted product data, user profile links, search data, and navigation categories",
      extractedData: {
        products: productData,
        profileLinks,
        searchData,
        categories,
        extractionTime: new Date().toISOString()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
